import React from 'react';
import '../styles/contact.css';

function Contact() {
  return (
    <div className="contact">
      <h1>Contacto</h1>
      <form className="contact-form">
        <label>Nombre</label>
        <input type="text" />
        <label>Email</label>
        <input type="email" />
        <button type="submit">Enviar</button>
      </form>
    </div>
  );
}

export default Contact;
